    "cortana_long_consent_terms_of_use_bullet_point6": "Секретні проекти. Вміст, пов’язаний із секретними проектами.",
    "cortana_long_consent_terms_of_use_head": "Користуючись цією функцією Teams, ви погоджуєтеся з наведеними далі умовами використання. Ця програма збирає мовні дані, необхідні для підвищення якості розпізнавання мовлення в Teams. Мовні дані використовуватимуться для навчання та перевірки наших моделей. Вміст і метадані мовних даних переглядатиме обмежене коло працівників і постачальників корпорації Майкрософт. Ви відповідаєте за взаємодію з цією функцією Teams, і за те, що не передаєте відомості, які не має бачити персонал, що працює над цими функціями. Не слід передавати інформацію з наведених нижче категорій:",
    "cortana_long_consent_text": "Зверніть увагу: якщо ви погодитеся ввімкнути цю функцію Teams, ми використовуватимемо ваші мовленнєві дані, щоб удосконалити розпізнавання мовлення в Teams. Розробка та вдосконалення цих моделей допоможуть створювати нові покращені функції для користувачів. Участь у цій програмі повністю добровільна, і жодних штрафів у випадку відмови немає. Ми не відстежуватимемо, хто бере участь, а хто – ні. Дякуємо за співпрацю!",
