    "edu_fre_quickguide_study_group_and_plc_overview": "Для кожної команди передбачено канали, де може спілкуватися вся група.",
    "edu_fre_quickguide_teams_app_overview_students": "Команди – це місце для співпраці в групах. Ви можете утворювати команди з класів або клубів.",
    "edu_fre_quickguide_teams_app_overview_teachers": "Команди – це місце для співпраці в класах, підрозділах або інших групах.",
    "edu_fre_simplifiedux_quickguide_channel_description": "У кожній команді є канали. Вважайте їх місцями для обговорення за темами або предметами.",
    "edu_fre_simplifiedux_quickguide_class_student_description": "Команда – це місце для співпраці класу, навчальної групи або клубу. Виберіть цю команду, щоб продовжити.",
    "edu_fre_simplifiedux_quickguide_class_team_description": "Команда – це місце для співпраці класів, підрозділів тощо. Виберіть цю команду, щоб продовжити.",
    "edu_fre_simplifiedux_quickguide_plc_channel_description": "У кожній команді є канали. Вважайте їх місцями для роботи за темами або проектами.",
    "edu_fre_simplifiedux_quickguide_plc_conversation_message": "Тут можна почати розмову та обмінюватися файлами з іншими учасниками команди.",
