    "edu_fre_welcome_card_button": "До справи!",
    "edu_fre_welcome_card_students": "Раді бачити учнів і студентів будь-яких предметів! Ласкаво просимо до Teams!<br /><br />Це ваш простір, де ви можете піднімати руку, ставити запитання групі, здавати домашні завдання 👏 та просто бути собою.",
    "edu_fre_welcome_card_teachers": "Раді бачити вчителів і викладачів будь-яких предметів! Ласкаво просимо до Teams!<br /><br />Це ваш простір, де ви можете збирати учнів або студентів у віртуальне коло, переглядати ідеї для роботи в класі, призначати курсові завдання, ділитися відгуками або просто спілкуватися з іншими.",
    "edu_fre_welcome_card_title": "У вас усе вийшло!",
    "edu_fre_welcome_help_coachmark_cta": "Зрозуміло",
    "edu_fre_welcome_help_coachmark_student": "<h1 class=\"welcome-help-coachmark-title\">Не знаєте, з чого почати?</h1>Перегляньте докладні відомості в таких темах:<br />1. Приєднання до онлайн-наради класу.<br />2. Як здавати завдання.<br />3. Поради для родин (якщо вам це потрібно).<br /><br />Також можете скористатися пошуком.",
    "edu_fre_welcome_help_coachmark_teacher": "<h1 class=\"welcome-help-coachmark-title\">Не знаєте, з чого почати?</h1>Перегляньте докладні відомості в таких темах:<br />1. Планування онлайн-наради з класом.<br />2. Публікація привітальних оголошень.<br />3. Створення першого завдання.<br /><br />Також можете скористатися пошуком.",
    "edu_help_coachmark_student": "<svg class='app-svg icons-faq icons-default-fill' style='margin-bottom: -0.2rem;'><use xlink:href='#icons-faq' href='#icons-faq'/></svg> <b>Довідка</b> <br /> <p style='margin-left: 0.5rem; margin-top: 0.6rem;'>Дізнайтеся більше про Teams і перегляньте поради та інструкції, корисні в навчанні.</p>",
    "edu_help_coachmark_teacher": "<svg class='app-svg icons-faq icons-default-fill' style='margin-bottom: -0.2rem;'><use xlink:href='#icons-faq' href='#icons-faq'/></svg> <b>Довідка</b> <br /> <p style='margin-left: 0.5rem; margin-top: 0.6rem;'>Перейдіть сюди, якщо маєте запитання. Тут можна знайти поради, навчальні відео й багато інших матеріалів, присвячених використанню \"Teams для освіти\".</p>",
    "edu_hover_last_modified_column_coachmark_teacher": "Запитання? Наведіть указівник миші на ім’я, щоб розпочати чат.",
    "edu_open_file_coachmark_teacher": "Користувач {{fullName}} щойно передав файл \"{{fileName}}\" до файлів вашої команди.",
    "edu_privacy_notice_title": "Повідомлення про конфіденційність",
    "edu_questions_for_users_coachmark": "Запитання? Зверніться до користувача \"{{firstName}}\".",
    "edu_start_chat_coachmark_button": "Почати чат",
    "edu_take_a_look_coachmark_button": "Поглянути",
    "edu_uae_privacy_alert_coachmark_button_text": "Докладніше",
    "edu_uae_privacy_alert_coachmark_text": "Ваш навчальний заклад керує тим, як ви використовуєте цей продукт Microsoft, і може переглядати та відкривати вміст, документи, електронні листи та повідомлення, а також відомості про те, з ким ви взаємодієте під час використання цього продукту. На використання можуть розповсюджуватися політики вашого навчального закладу та місцеве законодавство. Щоб дізнатися про політики, які на вас розповсюджуються, зверніться до свого навчального закладу. Щоб дізнатися про політики конфіденційності корпорації Майкрософт, виберіть пункт \"Докладніше\".",
