    "teams_feedback_dialog_logs_disclaimer_anonymous": "Ця форма дає змогу збирати та надсилати файли журналу Microsoft Teams (включно з особистою інформацією), щоб корпорація Майкрософт змогла краще проаналізувати проблему. Журнали оброблятимуться як \"дані служби підтримки\" згідно з угодою організатора про використання служб Microsoft 365. Під час розслідування проблеми зібрані засобом зворотного зв’язку журнали можуть передаватися й зберігатися (протягом щонайдовше 90 днів) за межами вашого географічного регіону, зокрема в США. Не надсилайте цей звіт, якщо така обробка порушить політику захисту даних вашої організації.",
